    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Jarvis Island NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Jarvis Island NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, and information about
    the management direction and Refuge resources. Key planning issues include: operational
    limitations, biological and ecological resources, external forces, public use resources,
    education and outreach, and communication and cooperation.",nt"license_title":
